import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import * as React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { Stack, Table, TableCell, TableRow } from '@mui/material';
import axios from 'axios';

export interface Settings {
  hosts: number;
  expected_instances: number;
  enabled_services: number;
}

export interface Status {
  healthy_hosts:      number;
  services_running:   number;
  instances_running:  number;
  unhealthy_hosts:    string[];
  unhealthy_services: string[];
  stopped_instances:  string[];
}


export function MediaCard() {  
  const [data, setData] = React.useState<Settings[]>([]);
  const getProductData = async () => {
  const url = 'http://127.0.0.1:8000/api/settings/';

    try {
      const data = await axios.get<Settings[]>(url);

      setData(data.data);
      console.log('Data:' + { data });
    } catch (e) {
      console.log(e);
    }
  };

  React.useEffect(() => {
    getProductData();
  }, []);

  return (
    <>
      {data.map((row) => (
        <Card sx={{ maxWidth: 350, boxShadow: 3, m: 1 }}>
          <CardContent>
            <Table>
              <TableRow>
                <TableCell sx={{ align: 'center' }}>{row.hosts}</TableCell>
                <TableCell sx={{ align: 'center' }}>
                  {row.expected_instances}
                </TableCell>
                <TableCell sx={{ align: 'center' }}>
                  {row.enabled_services}
                </TableCell>
              </TableRow>
              <TableRow>
                <TableCell>Hosts</TableCell>
                <TableCell>Expected Instances</TableCell>
                <TableCell>Enabled Services</TableCell>
              </TableRow>
            </Table>
          </CardContent>
          <CardActions sx={{ display: 'flex', justifyContent: 'flex-end' }}>
            <Button size="small">View Details</Button>
          </CardActions>
        </Card>
      ))}
    </>
  );
}

export function StatusCard() {  
  const [data, setData] = React.useState<Status[]>([]);
  const getProductData = async () => {
  const url = 'http://127.0.0.1:8000/api/status/';

    try {
      const data = await axios.get<Status[]>(url);

      setData(data.data);
      console.log('Data:' + { data });
    } catch (e) {
      console.log(e);
    }
  };

  React.useEffect(() => {
    getProductData();
  }, []);

  return (
    <>
      {data.map((row) => (
        <Card sx={{ maxWidth: 400, boxShadow: 3, m: 1 }}>
          <CardContent>
            <Table>
              <TableRow>
                <TableCell sx={{ align: 'center' }}>{row.healthy_hosts}</TableCell>
                <TableCell sx={{ align: 'center' }}>
                  {row.instances_running}
                </TableCell>
                <TableCell sx={{ align: 'center' }}>
                  {row.services_running}
                </TableCell>
                <TableCell>
                  {row.unhealthy_hosts.length}
                </TableCell>
                <TableCell>
                  {row.unhealthy_services.length}
                </TableCell>
              </TableRow>
              <TableRow>
                <TableCell> Healthy Hosts</TableCell>
                <TableCell>Running Instances</TableCell>
                <TableCell>Running Services</TableCell>
                <TableCell>Unhealthy Hosts</TableCell>
                <TableCell>Unhealthy Services</TableCell>
              </TableRow>
            </Table>
          </CardContent>
          <CardActions sx={{ display: 'flex', justifyContent: 'flex-end' }}>
            <Button size="small">View Details</Button>
          </CardActions>
        </Card>
      ))}
    </>
  );
}

export function NotificationsCard() {
  return (
    <Card sx={{ maxWidth: 500, boxShadow: 3, m: 1 }}>
      <CardMedia component="img" height="140" image="" alt="green iguana" />
      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          Lizard
        </Typography>
        <Typography variant="body2" color="text.secondary">
          Lizards are a widespread group of squamate reptiles, with over 6,000
          species, ranging across all continents except Antarctica
        </Typography>
      </CardContent>
      <CardActions>
        <Button size="small">Share</Button>
        <Button size="small">Learn More</Button>
      </CardActions>
    </Card>
  );
}

export function HealthCard() {
  return (
    <Card sx={{ maxWidth: 570, boxShadow: 3, m: 1 }}>
      <CardMedia component="img" height="140" image="" alt="green iguana" />
      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          Lizard
        </Typography>
        <Typography variant="body2" color="text.secondary">
          Lizards are a widespread group of squamate reptiles, with over 6,000
          species, ranging across all continents except Antarctica
        </Typography>
      </CardContent>
      <CardActions>
        <Button size="small">Share</Button>
        <Button size="small">Learn More</Button>
      </CardActions>
    </Card>
  );
}

export const Home = () => {
  return (
    <Box
      component="main"
      sx={{
        flexGrow: 0,
        p: 3,
        display: 'flex',
        alignItems: 'center',
        position: 'relative',
      }}
    >
      <Toolbar />
      {/* <h1>Home</h1> */}
      <Stack direction="column">
        <Stack direction="row">
          <MediaCard />
          <StatusCard />
          <MediaCard />
        </Stack>
        <Stack direction="row">
          <NotificationsCard />
          <HealthCard />
        </Stack>
      </Stack>
    </Box>
  );
};
